class Solution(object):
    def findMaxAverage(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: float
        """
        l, u = 0, k - 1  # 0 3
        su = float("-inf")
        su_t = sum(nums[l:k])
        while 1:
            if su_t > su:
                su = su_t
            l = l + 1
            u = u + 1
            if u > len(nums) - 1:
                break
            else:
                su_t -= nums[l - 1]
                su_t += nums[u]

        return float(su) / float(k)


